    //             users: response.data
    //         })
    //     })
    //     .catch(error => {
    //         console.log(error)
    //     })
    // }
    componentDidMount() {
        // Simple GET request using axios
        axios.get('https://api.npms.io/v2/search?q=react')
            .then(response => this.setState({ totalReactPackages: response.data.total }));
    }
    render() { 
        let info = this.state.users

        const mainData = info.map((data, index) => {
            return(
                <div key={data.id}>
                    {data.name}
                </div>
            )
        })
        return ( 
            <div>
                {
                    <p>{mainData}</p>
                }
            </div>
         );
    }
}

export default Main;
